// pascalLexerInit initializes any static state used to implement pascalLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewpascalLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func PascalLexerInit() {
	staticData := &PascalLexerLexerStaticData
	staticData.once.Do(pascallexerLexerInit)
}

// NewpascalLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewpascalLexer(input antlr.CharStream) *pascalLexer {
	PascalLexerInit()
	l := new(pascalLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &PascalLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "pascal.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

